import{_ as e,c as a,o as t,d as r}from"./app.e5528619.js";const u=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[{"level":2,"title":"title: \u5468\u7231\u6C11-JavaScript\u6838\u5FC3\u539F\u7406\u89E3\u6790","slug":"title-\u5468\u7231\u6C11-javascript\u6838\u5FC3\u539F\u7406\u89E3\u6790","link":"#title-\u5468\u7231\u6C11-javascript\u6838\u5FC3\u539F\u7406\u89E3\u6790","children":[]},{"level":2,"title":"\u8981\u77E5\u9053\u81EA\u5DF1\u6240\u5728\u7684\u4F4D\u7F6E","slug":"\u8981\u77E5\u9053\u81EA\u5DF1\u6240\u5728\u7684\u4F4D\u7F6E","link":"#\u8981\u77E5\u9053\u81EA\u5DF1\u6240\u5728\u7684\u4F4D\u7F6E","children":[]},{"level":2,"title":"\u8981\u77E5\u9053\u81EA\u5DF1\u6240\u89C1\u7684\u5C40\u9650","slug":"\u8981\u77E5\u9053\u81EA\u5DF1\u6240\u89C1\u7684\u5C40\u9650","link":"#\u8981\u77E5\u9053\u81EA\u5DF1\u6240\u89C1\u7684\u5C40\u9650","children":[]},{"level":2,"title":"\u601D\u8003\u624D\u662F\u8FDB\u6B65\u7684\u672C\u8D28","slug":"\u601D\u8003\u624D\u662F\u8FDB\u6B65\u7684\u672C\u8D28","link":"#\u601D\u8003\u624D\u662F\u8FDB\u6B65\u7684\u672C\u8D28","children":[]}],"relativePath":"JavaScript/\u5468\u7231\u6C11-JavaScript\u6838\u5FC3\u539F\u7406\u89E3\u6790/\u7ED3\u675F\u8BED-\u613F\u4F60\u80FD\u505A\u4E00\u4E2A\u771F\u6B63\u201C\u61C2\u201D\u7684\u7A0B\u5E8F\u5458.md"}'),p={name:"JavaScript/\u5468\u7231\u6C11-JavaScript\u6838\u5FC3\u539F\u7406\u89E3\u6790/\u7ED3\u675F\u8BED-\u613F\u4F60\u80FD\u505A\u4E00\u4E2A\u771F\u6B63\u201C\u61C2\u201D\u7684\u7A0B\u5E8F\u5458.md"},i=r('<hr><h2 id="title-\u5468\u7231\u6C11-javascript\u6838\u5FC3\u539F\u7406\u89E3\u6790" tabindex="-1">title: \u5468\u7231\u6C11-JavaScript\u6838\u5FC3\u539F\u7406\u89E3\u6790 <a class="header-anchor" href="#title-\u5468\u7231\u6C11-javascript\u6838\u5FC3\u539F\u7406\u89E3\u6790" aria-hidden="true">#</a></h2><p>\u7ED3\u675F\u8BED | \u613F\u4F60\u80FD\u505A\u4E00\u4E2A\u771F\u6B63\u201C\u61C2\u201D\u7684\u7A0B\u5E8F\u5458</p><p>\u6211\u5E38\u5E38\u8BB2\u4E00\u4E2A\u6BD4\u55BB\uFF0C\u8FD9\u4E2A\u6BD4\u55BB\u662F\u8BF4\u6709\u4E00\u5EA7\u5854\uFF0C\u5854\u95E8\u53E3\u6709\u4E24\u5C0A\u77F3\u72EE\u5B50\u3002</p><p>\u5982\u679C\u6709\u4EBA\u767B\u5854\uFF0C\u90A3\u4E48\u8FDB\u5854\u4E4B\u524D\u4ED6\u56FA\u7136\u662F\u4F1A\u770B\u5230\u8FD9\u4E2A\u72EE\u5B50\u7684\uFF0C\u5F80\u4E0A\u8D70\uFF0C\u6B63\u597D\u5230\u5854\u540E\uFF0C\u77F3\u72EE\u5B50\u5C31\u6CA1\u6709\u4E86\uFF0C\u4E8E\u662F\u8FD9\u4E2A\u4EBA\u8BF4\u201C\u5C31\u6211\u4E00\u697C\u4E4B\u6240\u89C1\uFF0C\u6CA1\u6709\u72EE\u5B50\u201D\uFF1B\u7ED5\u5230\u524D\u9762\uFF0C\u4E00\u770B\uFF0C\u77F3\u72EE\u5B50\u597D\u597D\u5730\u5728\u90A3\u513F\uFF0C\u4E8E\u662F\u8FD9\u4E2A\u4EBA\u53C8\u8BF4\u201C\u4E8E\u6211\u6240\u89C1\uFF0C\u6709\u72EE\u5B50\u201D\u3002\u5982\u6B64\u884C\u81F3\u4E8C\u697C\uFF0C\u4ED6\u53C8\u4F1A\u8BF4\u201C\u6CA1\u6709\u72EE\u5B50\u201D\uFF0C\u800C\u540E\u53C8\u5426\u5B9A\u8BF4\u201C\u771F\u771F\u5207\u5207\u662F\u6709\u72EE\u5B50\u5728\u7684\u201D\u3002</p><p>\u5BF9\u4E8E\u65C1\u4EBA\u6765\u8BF4\uFF1A\u53EA\u542C\u8FD9\u4E2A\u4EBA\u8BB2\u201C\u6709\uFF0C\u6216\u6CA1\u6709\u201D\u72EE\u5B50\uFF0C\u4F1A\u77E5\u9053\u4ED6\u5728\u51E0\u697C\u5417\uFF1F\u53C8\u6216\u8005\u8BF4\uFF0C\u5C31\u7B97\u77E5\u9053\u8FD9\u4E2A\u4EBA\u5728\u51E0\u697C\uFF0C\u53C8\u80FD\u77E5\u9053\u4ED6\u8BF4\u201C\u6709\uFF0C\u6216\u6CA1\u6709\u201D\u72EE\u5B50\uFF0C\u662F\u7EFC\u89C8\u4E8B\u5B9E\u4E4B\u6240\u89C1\uFF0C\u8FD8\u662F\u672A\u89C1\u4E8B\u5B9E\u5168\u8C8C\u65F6\u7684\u4E00\u65F6\u6240\u8A00\uFF1F\u4F60\u5176\u5B9E\u5E76\u4E0D\u77E5\u9053\u3002</p><p>\u6211\u4EEC\u53EA\u662F\u8981\u4E48\u76F8\u4FE1\u4E86\u5BF9\u65B9\u6240\u5728\u7684\u9AD8\u5EA6\uFF0C\u8981\u4E48\u8BA4\u53EF\u4E86\u5BF9\u65B9\u6240\u8A00\u7684\u771F\u5047\u3002\u800C\u5927\u591A\u6570\u65F6\u5019\uFF0C\u6211\u4EEC\u5176\u5B9E\u65E0\u4ECE\u5224\u65AD\uFF1A\u90A3\u4E2A\u4EBA\u8BF4\u7684\u662F\u4E0D\u662F\u5BF9\u7684\uFF0C\u53C8\u6216\u8005\u4ED6\u8BF4\u7684\uFF0C\u7A76\u7ADF\u662F\u5728\u51E0\u5C42\u697C\u4E0A\u770B\u89C1\u7684\u77F3\u72EE\u5B50\u3002</p><p>\u6BCF\u4E00\u5C42\u53EF\u89C1\u7684\u72EE\u5B50\uFF0C\u90FD\u662F\u76F8\u540C\u7684\u72EE\u5B50\uFF1B\u4F46\u6BCF\u4E00\u6B21\u7684\u6240\u89C1\uFF0C\u5374\u4E0D\u76F8\u540C\u3002\u540C\u6837\u662F\u771F\u7406\uFF0C\u5728\u521D\u5B66\u8005\u548C\u5927\u5E08\u7684\u53E3\u4E2D\u8BF4\u51FA\u6765\uFF0C\u5C3D\u7BA1\u5B57\u9762\u4E0A\u90FD\u662F\u4E00\u6837\u7684\uFF0C\u4F46\u662F\u5374\u5305\u542B\u7740\u4E0D\u540C\u9AD8\u5EA6\u7684\u7406\u89E3\u3002\u6240\u8C13\u5927\u5E08\uFF0C\u4E5F\u4E0D\u8FC7\u662F\u5148\u884C\u8005\uFF0C\u53EA\u662F\u4ED6\u5904\u5728\u7684\u697C\u5C42\uFF0C\u51B3\u5B9A\u4E86\u4ED6\u770B\u5F97\u89C1\u4E0B\u9762\u6240\u6709\u7684\u5C42\u6B21\u4E0A\u7684\u771F\u76F8\uFF0C\u4E5F\u8FA8\u5F97\u6E05\u6BCF\u4E00\u5C42\u6240\u89C1\u7684\u77F3\u72EE\u5B50\u7684\u6837\u5B50\u3002</p><p>\u6240\u4EE5\uFF0C\u6240\u8C13\u201C\u61C2\u201D\uFF0C\u5176\u5B9E\u8BF4\u7684\u4E0D\u662F\u4E00\u4E2A\u7ED3\u679C\uFF0C\u800C\u662F\u4E00\u4E2A\u72B6\u6001\uFF1A\u77E5\u9053\u81EA\u5DF1\u6240\u5728\u4E4B\u4F4D\u7F6E\u7684\uFF0C\u624D\u662F\u771F\u7684\u61C2\uFF1B\u77E5\u9053\u81EA\u5DF1\u6240\u89C1\u4E4B\u5C40\u9650\u7684\uFF0C\u624D\u662F\u771F\u7684\u61C2\uFF1B\u77E5\u9053\u81EA\u5DF1\u6240\u5411\u4E4B\u6E6E\u8FDC\u7684\uFF0C\u624D\u662F\u771F\u7684\u61C2\u3002</p><h2 id="\u8981\u77E5\u9053\u81EA\u5DF1\u6240\u5728\u7684\u4F4D\u7F6E" tabindex="-1">\u8981\u77E5\u9053\u81EA\u5DF1\u6240\u5728\u7684\u4F4D\u7F6E <a class="header-anchor" href="#\u8981\u77E5\u9053\u81EA\u5DF1\u6240\u5728\u7684\u4F4D\u7F6E" aria-hidden="true">#</a></h2><p>\u6211\u5199\u8FC7\u300A\u7A0B\u5E8F\u539F\u672C\u300B\uFF0C250\u591A\u9875\u7684\u5185\u5BB9\uFF0C\u7136\u800C\u5230\u4E86\u300A\u6211\u7684\u67B6\u6784\u601D\u60F3\u300B\u4E2D\uFF0C\u5C31\u53EA\u7559\u4E0B\u4E86\u4E00\u53E5\u201C\u7A0B\u5E8F\u662F\u53EF\u88AB\u7EC4\u7EC7\u7684\u5143\u7D20\u201D\u3002</p><p>\u53EA\u6709\u6709\u4E86\u8FD9\u4E00\u53E5\u8BDD\u7684\u94FA\u57AB\uFF0C\u67B6\u6784\u601D\u60F3\u624D\u6210\u7ACB\uFF0C\u5426\u5219\u6240\u8C13\u601D\u60F3\u5C31\u6210\u4E86\u7A7A\u7ACB\u5728\u6587\u5B57\u4E4B\u4E0A\u7684\u4E1C\u897F\uFF0C\u662F\u7A7A\u6D1E\u8D2B\u4E4F\u7684\u5453\u8BED\u4E86\u3002\u6B63\u662F\u8FD9\u4E9B\u5E74\u6765\u7684\u7ECF\u5386\uFF0C\u8BA9\u6211\u627E\u5230\u4E86\u81EA\u5DF1\u5728\u201C\u7A0B\u5E8F\u201D\u8FD9\u4E2A\u4E8B\u7269\u4E2D\u7684\u4F4D\u7F6E\uFF0C\u4ECE\u800C\u627E\u5230\u4E86\u6211\u5728\u201C\u67B6\u6784\u201D\u8FD9\u4E2A\u4E8B\u7269\u4E2D\u7684\u57FA\u7840\uFF1B\u524D\u8005\u7684\u4F4D\u7F6E\uFF0C\u51B3\u5B9A\u4E86\u540E\u8005\u7684\u9AD8\u5EA6\u3002</p><p>\u800C\u300AJavaScript\u6838\u5FC3\u539F\u7406\u89E3\u6790\u300B\u8FD9\u95E8\u8BFE\u7A0B\u4E00\u76F4\u5728\u505A\u7684\uFF0C\u5C31\u662F\u5E2E\u4F60\u627E\u5230\u8FD9\u6837\u7684\u4E00\u4E2A\u94FA\u57AB\uFF0C\u5B83\u65E0\u975E\u662F\u4E00\u4E2A\u8D77\u70B9\uFF0C\u8FD9\u4E2A\u8D77\u70B9\u662F\u4F60\u6784\u5EFA\u8BED\u8A00\u4F53\u7CFB\u65F6\uFF0C\u6240\u94FA\u4E0B\u7684\u7B2C\u4E00\u5757\u57FA\u77F3\u3002\u5018\u82E5\u5B83\u80FD\u5E2E\u52A9\u4F60\u4EE5\u6B64\u4E3A\u57FA\u70B9\u5148\u884C\u4E00\u6B65\uFF0C\u90A3\u4E48\u8FD9\u5C31\u662F\u8FD9\u95E8\u8BFE\u7684\u4EF7\u503C\u6240\u5728\uFF0C\u4E5F\u662F\u4F60\u4E0E\u4F17\u4E0D\u540C\u7684\u4EF7\u503C\u6240\u5728\u3002</p><h2 id="\u8981\u77E5\u9053\u81EA\u5DF1\u6240\u89C1\u7684\u5C40\u9650" tabindex="-1">\u8981\u77E5\u9053\u81EA\u5DF1\u6240\u89C1\u7684\u5C40\u9650 <a class="header-anchor" href="#\u8981\u77E5\u9053\u81EA\u5DF1\u6240\u89C1\u7684\u5C40\u9650" aria-hidden="true">#</a></h2><p>\u5728<a href="https://time.geekbang.org/column/article/185031" target="_blank" rel="noreferrer">\u7B2C22\u8BB2</a>\uFF0C\u4E5F\u5C31\u662F\u6700\u540E\u7684\u4E00\u8BB2\u4E2D\uFF0C\u6211\u5199\u4E869\u4E2ANOTE\uFF0C\u6765\u6307\u5411\u6B64\u524D\u5728\u5176\u5B83\u7AE0\u8282\u4E2D\u6240\u8BB2\u8FF0\u7684\u5185\u5BB9\u3002\u6211\u4E0D\u77E5\u9053\u4F60\u662F\u5426\u6CE8\u610F\u5230\u4E86\u8FD9\u4E00\u70B9\uFF0C\u53C8\u662F\u5426\u7406\u89E3\u8FD9\u5176\u4E2D\u7684\u7528\u610F\u3002</p><p>\u5176\u5B9E\u6BCF\u4E00\u4E2A\u8BFE\u7A0B\uFF0C\u4E43\u81F3\u4E8E\u6BCF\u4E00\u7BC7\u6587\u7AE0\uFF0C\u90FD\u662F\u7531\u66F4\u591A\u7684\u77E5\u8BC6\u6765\u7EC4\u6210\u7684\u3002\u4F60\u80FD\u8BFB\u660E\u767D\u7B2C22\u8BB2\uFF0C\u662F\u6E90\u81EA\u4E8E\u524D21\u8BB2\u7684\u79EF\u7D2F\uFF0C\u5E76\u4E0D\u662F\u4E00\u8E74\u800C\u5C31\u7684\u3002</p><p>\u7136\u800C\u8BFB\u5F97\u660E\u767D\u7B2C22\u8BB2\uFF0C\u4E5F\u5E76\u4E0D\u662F\u771F\u7684\u61C2\u4E86\u3002\u4F60\u8981\u770B\u5F97\u5230\u524D\u9762\u7684\u90A3\u4E9B\u77E5\u8BC6\u3001\u90A3\u4E9B\u7EC6\u8282\uFF0C\u4F60\u8FD8\u8981\u628A\u8FD9\u4E9B\u77E5\u8BC6\u4E0E\u7EC6\u8282\u5F52\u7EB3\u8D77\u6765\uFF0C\u5F62\u6210\u7ED3\u6784\uFF0C\u5F62\u6210\u4F53\u7CFB\uFF0C\u5F62\u6210\u4E00\u4E2A\u7B80\u5355\u7684\u6A21\u578B\u6216\u6982\u5FF5\u3002\u8FD9\u4E9B\u662F\u4F60\u6240\u89C1\u5230\u7684\u4E1C\u897F\uFF0C\u800C\u4E0D\u518D\u4EC5\u4EC5\u662F\u6211\u7684\u8BB2\u8FF0\u3002\u4F60\u56DE\u5FC6\u5F97\u8D77\u6765\u6211\u7684\u6240\u8FF0\uFF0C\u53EA\u8BF4\u660E\u4F60\u7684\u8BB0\u6027\u597D\uFF1B\u8981\u6784\u5EFA\u5F97\u4E86\u81EA\u5DF1\u7684\u89C1\u8BC6\uFF0C\u624D\u8BF4\u660E\u4F60\u5F00\u59CB\u61C2\u4E86\u3002</p><p>\u8981\u6709\u6240\u89C1\uFF0C\u4F46\u4E5F\u4E0D\u8981\u56FA\u6267\u4E8E\u5DF2\u89C1\uFF0C\u90A3\u6837\u5C31\u6CA1\u6709\u8FDB\u6B65\u4E86\u3002\u8FD9\u4E2A\u8FDB\u6B65\u7684\u8FC7\u7A0B\uFF0C\u624D\u662F\u771F\u7684\u61C2\u3002\u6240\u8C13\u8FDB\u6B65\uFF0C\u4E0D\u662F\u5426\u5B9A\u522B\u4EBA\uFF0C\u800C\u662F\u5426\u5B9A\u81EA\u5DF1\u3002</p><h2 id="\u601D\u8003\u624D\u662F\u8FDB\u6B65\u7684\u672C\u8D28" tabindex="-1">\u601D\u8003\u624D\u662F\u8FDB\u6B65\u7684\u672C\u8D28 <a class="header-anchor" href="#\u601D\u8003\u624D\u662F\u8FDB\u6B65\u7684\u672C\u8D28" aria-hidden="true">#</a></h2><p>\u505C\u4E0B\u6765\uFF0C\u601D\u8003\u624D\u662F\u8FDB\u6B65\u7684\u672C\u8D28\uFF01</p><p>\u8FD9\u662F\u674E\u7EF4\u5148\u751F\u5341\u51E0\u5E74\u524D\u540C\u6211\u8BF4\u7684\u3002\u6211\u628A\u8FD9\u53E5\u8BDD\u5199\u5728\u4E86\u300A\u5927\u9053\u81F3\u7B80\u300B\u8FD9\u672C\u4E66\u7684\u5E8F\u91CC\uFF0C\u4E5F\u8BB0\u5728\u4E86\u6211\u7684\u601D\u60F3\u4E2D\u3002\u56E0\u800C\u6211\u5E38\u5E38\u4F1A\u505C\u4E0B\u6765\uFF0C\u4E0D\u53BB\u6025\u4E8E\u5F97\u5230\u7ED3\u679C\uFF0C\u800C\u662F\u53BB\u770B\u770B\u6211\u60F3\u8981\u7684\u662F\u4EC0\u4E48\uFF0C\u671F\u671B\u7684\u65B9\u5411\u53C8\u662F\u4EC0\u4E48\u3002\u6211\u603B\u89C9\u5F97\uFF0C\u8FD9\u4E9B\u5F80\u5F80\u662F\u66F4\u91CD\u8981\u7684\u3002</p><p>\u5982\u679C\u4EE5\u201C\u6784\u5EFA\u8BED\u8A00\u4F53\u7CFB\u201D\u4F5C\u4E3A\u76EE\u6807\uFF0C\u90A3\u4E48\u6211\u5F88\u96BE\u5411\u4F60\u63CF\u8FF0\u90A3\u7EDD\u9876\u5904\u7684\u98CE\u5149\uFF0C\u6211\u6240\u80FD\u5C55\u793A\u7684\uFF0C\u4E5F\u4EC5\u4EC5\u662F\u8FD9\u4E2A\u5854\u4E0A\u67D0\u4E00\u5C42\u7684\u6240\u89C1\u800C\u5DF2\u3002\u6211\u4ECD\u524D\u884C\u4E0D\u8F8D\uFF0C\u4ECD\u7136\u65F6\u6709\u65B0\u601D\uFF0C\u6211\u4ECD\u613F\u610F\u5C06\u5BF9\u4E8E\u201C\u77F3\u72EE\u5B50\u201D\u7684\u6BCF\u4E2A\u70B9\u6EF4\u89C2\u5BDF\u4E0E\u4F60\u5206\u4EAB\u3002\u98CE\u8D77\u4E86\uFF0C\u8D77\u70B9\u8D8A\u6765\u8D8A\u8FDC\uFF0C\u6211\u56DE\u5934\u671B\u5411\u77F3\u72EE\u5B50\u7684\u65F6\u5019\uFF0C\u5B83\u90FD\u6E3A\u8FDC\u5230\u51E0\u4E4E\u518D\u4E5F\u770B\u4E0D\u89C1\u4E86\u2026\u2026\u4F46\u6211\u77E5\u9053\uFF0C\u8FD9\u610F\u5473\u7740\u7EC8\u70B9\u4E5F\u5C31\u8D8A\u6765\u8D8A\u8FD1\u4E86\u3002</p><p>\u201C\u4FEF\u4EF0\u53F9\u5C71\u4F4E\u5929\u5C0F\u201D\uFF0C\u8FD9\u53E5\u8BD7\u8BB2\u7684\u4FBF\u662F\u767B\u4E34\u5C71\u9876\u7684\u5FEB\u610F\u3002\u5F7C\u65F6\u5F7C\u5904\uFF0C\u6C5D\u53EF\u5728\u5426\uFF1F\uFF01</p><p>\u8C22\u8C22\u4F60\u7684\u6536\u542C\uFF0C\u613F\u4F60\u80FD\u505A\u4E00\u4E2A\u771F\u6B63\u201C\u61C2\u201D\u7684\u7A0B\u5E8F\u5458\u3002</p>',24),_=[i];function l(c,n,s,d,h,o){return t(),a("div",null,_)}const f=e(p,[["render",l]]);export{u as __pageData,f as default};
